import { StyleSheet, Text, View } from "react-native";
import React from "react";

const Message = () => {
  return (
    <View>
      <View style={styles.message}>
        <Text>Hello</Text>
      </View>
    </View>
  );
};

export default Message;

const styles = StyleSheet.create({
  message: {
    alignItems: "center",
  },
});
